import Home from "pages/Home";
import { HashRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <HashRouter>
      <Routes>
        <Route path="/" exact element={<Home />} />
      </Routes>
    </HashRouter>
  );
}

export default App;
